import React from "react";
import { Icon } from "Shared/svg/Icon";
import SimpleSlider from "Shared/PhotoSlider/SimpleSlider";
import Data from "Entites/Data";
import {
  PhotoConteiner,
  SimpleSliderConteiner,
  AddBtn,
  VectorTop,
  MainConteiner,
  InfoConteiner,
  PersonConteiner,
} from "./style";
import AboutPerson from "./about/AboutPerson";

export default function PersonPage() {
  const { name, surname, patronymic, position } = Data.person;
  return (
    <MainConteiner>
      <PhotoConteiner>
        <SimpleSliderConteiner>
          <SimpleSlider />
        </SimpleSliderConteiner>
        <AddBtn>Добавить в контакты</AddBtn>
      </PhotoConteiner>
      <InfoConteiner>
        <Icon id="man" className="man" />
        <VectorTop />
        <PersonConteiner>
          <AboutPerson />
        </PersonConteiner>
      </InfoConteiner>
    </MainConteiner>
  );
}
